import { motion } from 'framer-motion'
import React from 'react'
import { Link } from 'react-router-dom'
import styled from 'styled-components'

const Container = styled.div`
	position: absolute;
	top: 1rem;
	left: 1rem;
	width: 100%;
	color: ${props => props.theme.text};
	z-index: 5;

	svg {
		width: 4rem;
		height: auto;
		overflow: visible;
		stroke-linejoin: round;
		stroke-linecap: round;
		g {
			path {
				stroke: ${props => props.theme.text};
			}
		}
	}
`
const Logo = () => {
  return (
    <Container>
      <Link to='/'>
        <svg
          xmlns='http://www.w3.org/2000/svg'
          enable-background='new 0 0 24 24'
          height='48px'
          viewBox='0 0 24 24'
          width='48px'
          fill='none'
				>
          <g>
            <motion.path d='M12,17.27L18.18,21l-1.64-7.03L22,9.24l-7.19-0.61L12,2L9.19,8.63L2,9.24l5.46,4.73L5.82,21L12,17.27z' />
          </g>
        </svg>
      </Link>
    </Container>
  )
}

export default Logo
